import React from "react";
import "../styles/Pages.css";

const Awards = () => {
  const awards = [
    { title: "Best Picture: Everything Everywhere All at Once", imageUrl: "https://images-na.ssl-images-amazon.com/images/S/pv-target-images/66ba82dfcf28ac01732046c8799b553aeb0ec416203e5f5062aa0ff7b30cfd31._RI_V_TTW_.jpg" },
    { title: "Best Director: Daniel Kwan, Daniel Scheinert", imageUrl: "https://i.pinimg.com/originals/cb/ce/2a/cbce2a73b3f68f6c37df29afce33b72e.jpg" },
    { title: "Best Actor: Brendan Fraser", imageUrl: "" },
    { title: "Best Actress: Michelle Yeoh", imageUrl: "https://image.tmdb.org/t/p/w500/uh9bQYPKMtQW0ugIn9vxYftl4To.jpg" },
    { title: "Best Supporting Actor: Ke Huy Quan", imageUrl: "https://image.tmdb.org/t/p/w500/soAl9zTqJkDOF2e30wMI04nC7hg.jpg" },
    { title: "Best Supporting Actress: Jamie Lee Curtis", imageUrl: "https://image.tmdb.org/t/p/w500/9ghFgr2HoZqDk9seZt7r3yA78S9.jpg" },
    { title: "Best Cinematography: Darius Khondji", imageUrl: "https://image.tmdb.org/t/p/w500/fYevay0qUMdPgjQmTQDwWhjxgh1.jpg" },
    { title: "Best Editing: Paul Rogers", imageUrl: "https://image.tmdb.org/t/p/w500/yMK3l7K7TVFgIbdHZhLx2he2qgV.jpg" },
    { title: "Best Costume Design: Ruth E. Carter", imageUrl: "https://image.tmdb.org/t/p/w500/vDNWmkOHF5kc5JeLOo3sjjFf9Sc.jpg" },
    { title: "Best Makeup: The Whale", imageUrl: "https://image.tmdb.org/t/p/w500/cAMonwvxtKhFpl4u91v0Bdpk0w1.jpg" }
  ];

  return (
    <div className="awards">
      <h1>Awards</h1>
      <div className="awards-list">
        {awards.map((award, index) => (
          <div className="award" key={index}>
            <img src={award.imageUrl} alt={award.title} />
            <p>{award.title}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Awards;
